code_examples.example:
# Command :- ::ixiangpf::emulation_isis_config

# This example will configure a ISIS router

set isis_status [::ixiangpf::emulation_isis_config          \
	-mode 			  create		    \
	-handle 		  <ethernet_1_handle>       \
	-discard_lsp 		  0			    \
	-intf_type 		  ptop 			    \
	-routing_level 		  L2 			    \
	-system_id 		  64:01:00:01:00:00    	    \
	-active 		  1 			    \
	-if_active 		  1 			    \
]

# The command above will generate output as shown below:
# {status 1} {isis_l3_handle isisL3} 
# {isis_l3_te_handle isisTe} 
# {isis_l3_router_handle isisL3Router} 
# {srgb_range_handle_rtr srgbRangeHandleRtr1} 
# {srlg_range_handle_rtr srlgRangeHandleRtr1} 
# {sr_algoList_handle_rtr srAlgoListHandleRtr1} 
# {srlb_descList_handle_rtr srlbDesclistHandleRtr1}

This example will modify the ISIS router

set isis_modified [::ixiangpf::emulation_isis_config        \
    -mode                         modify                    \
    -handle                       <isis_handle>             \
    -active                       0                         \
]

# The command above will generate output as shown below:
# {status 1}

# Command :- ixiangpf.emulation_isis_config # This example will configure a ISIS router
status = ixiangpf.emulation_isis_config( mode = "create", handle = "<ethernet_1_handle>", discard_lsp = "0", intf_type = "ptop", routing_level = "L2", system_id = "64:01:00:01:00:00", active = "1", if_active = "1", ) # The command above will generate output as shown below: # {'status' : '1', 'isis_l3_handle' : 'isisL3', # 'isis_l3_te_handle' : 'isisTe', # 'isis_l3_router_handle' : 'isisL3Router', # 'srgb_range_handle_rtr' : 'srgbRangeHandleRtr1', # 'srlg_range_handle_rtr' : 'srlgRangeHandleRtr1', # 'sr_algoList_handle_rtr' : 'srAlgoListHandleRtr1', # 'srlb_descList_handle_rtr' : 'srlbDesclistHandleRtr1'}
status = ixiangpf.emulation_isis_config( mode = "modify", handle = "<isis_handle>", active = "0", ) # The command above will generate output as shown below: # {'status' : '1'}

# Command :- ixiangpf::emulation_isis_config
# This example will configure a ISIS router
my $isis_status = ixiangpf::emulation_isis_config ({
    mode                                                        => "create",
    handle                                                      => "<ethernet_1_handle>",
    discard_lsp                                                 => "0",
    intf_type                                                   => "ptop",
    routing_level                                               => "L2",
    system_id                                                   => "64:01:00:01:00:00",
    active                                                      => "1",
    if_active                                                   => "1",
});
# The command above will generate output as shown below:
# {status 1} {isis_l3_handle isisL3} 
# {isis_l3_te_handle isisTe} 
# {isis_l3_router_handle isisL3Router} 
# {srgb_range_handle_rtr srgbRangeHandleRtr1} 
# {srlg_range_handle_rtr srlgRangeHandleRtr1} 
# {sr_algoList_handle_rtr srAlgoListHandleRtr1} 
# {srlb_descList_handle_rtr srlbDesclistHandleRtr1}
my $isis_modified = ixiangpf::emulation_isis_config ({
    mode                                                        => "modify",
    handle                                                      => "<isis_handle>",
    active                                                      => "0",
});
# The command above will generate output as shown below:
# {status 1}

# Command :- Emulation Isis Config # This example will configure a ISIS router
${result} = Emulation Isis Config mode=create handle=<ethernet_1_handle> discard_lsp=0 intf_type=ptop ... routing_level=L2 system_id=64:01:00:01:00:00 active=1 if_active=1 ${status} = Get From Dictionary ${result} status Run Keyword If '${status}' != '1' FAIL "Error: Status is not SUCCESS" ELSE Log "Status is SUCCESS" ${isis_status} = Get From Dictionary ${result} isis_status
# The command above will generate output as shown below: # {'status' : '1', 'isis_l3_handle' : 'isisL3', # 'isis_l3_te_handle' : 'isisTe', # 'isis_l3_router_handle' : 'isisL3Router', # 'srgb_range_handle_rtr' : 'srgbRangeHandleRtr1', # 'srlg_range_handle_rtr' : 'srlgRangeHandleRtr1', # 'sr_algoList_handle_rtr' : 'srAlgoListHandleRtr1', # 'srlb_descList_handle_rtr' : 'srlbDesclistHandleRtr1'}
${result} = Emulation Isis Config mode=modify handle=<isis_handle> active=0 ${status} = Get From Dictionary ${result} status Run Keyword If '${status}' != '1' FAIL "Error: Status is not SUCCESS" ELSE Log "Status is SUCCESS" ${isis_modified} = Get From Dictionary ${result} isis_modified
# The command above will generate output as shown below: # {'status' : '1'}
